import React, { useEffect, useState } from "react";
import {
  LineChart, Line,
  PieChart, Pie, Cell,
  BarChart, Bar, XAxis, YAxis, Tooltip, Legend
} from "recharts";
import "./Dashboard.css";

const COLORS = ["#0088FE", "#00C49F", "#FFBB28", "#FF8042"];

export default function EmployeeDashboard() {
  const [wasteIntakeData, setWasteIntakeData] = useState([]);
  const [processingStatusData, setProcessingStatusData] = useState([]);
  const [productListingData, setProductListingData] = useState([]);
  const [certificationReports, setCertificationReports] = useState([]);

  useEffect(() => {
    // Fetch waste intake data
    fetch("http://localhost:8085/intake/get")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch waste intake data");
        }
        return response.json();
      })
      .then((data) => setWasteIntakeData(data))
      .catch((error) => console.error("Error fetching waste intake data:", error));

    // Fetch processing status data
    fetch("http://localhost:8085/processing/status")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch processing status data");
        }
        return response.json();
      })
      .then((data) => setProcessingStatusData(data))
      .catch((error) => console.error("Error fetching processing status data:", error));

    // Fetch product listing data
    fetch("http://localhost:8085/products/list")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch product listing data");
        }
        return response.json();
      })
      .then((data) => setProductListingData(data))
      .catch((error) => console.error("Error fetching product listing data:", error));

    // Fetch certification reports
    fetch("http://localhost:8085/reports/certifications")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch certification reports");
        }
        return response.json();
      })
      .then((data) => setCertificationReports(data))
      .catch((error) => console.error("Error fetching certification reports:", error));
  }, []);

  return (
    <div className="contain">
      <div className="employee-dashboard">
        <div className="welcome-banner">
          <h1>Welcome, Employee!</h1>
          <p>Your hub for managing waste processing and product operations efficiently.</p>
        </div>

        <div className="key-metrics">
          <h2>Operational Metrics</h2>
          <div className="metrics-grid">
            <div className="metric-card">
              <h3>Total Waste Intake</h3>
              <p>{wasteIntakeData.reduce((sum, item) => sum + item.weight, 0).toFixed(2)} kg</p>
            </div>
            <div className="metric-card">
              <h3>Processed Waste Status</h3>
              <p>{processingStatusData.length} Active Processes</p>
            </div>
            <div className="metric-card">
              <h3>Product Listings</h3>
              <p>{productListingData.length} Available Products</p>
            </div>
            <div className="metric-card">
              <h3>Certification Reports</h3>
              <p>{certificationReports.length} Reports Generated</p>
            </div>
          </div>
        </div>

        <div className="analytics-overview">
          <h2>Analytics Overview</h2>
          <div className="analytics-grid">
            <div className="chart-container">
              <h4>Waste Intake Trend</h4>
              <LineChart width={300} height={300} data={wasteIntakeData}>
                <XAxis dataKey="date" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="weight" stroke="#8884d8" />
              </LineChart>
            </div>

            <div className="chart-container">
              <h4>Processing Status Distribution</h4>
              <PieChart width={300} height={300}>
                <Pie
                  data={processingStatusData}
                  dataKey="count"
                  nameKey="status"
                  cx="50%"
                  cy="50%"
                  outerRadius={100}
                  fill="#8884d8"
                >
                  {processingStatusData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                  ))}
                </Pie>
                <Tooltip />
              </PieChart>
            </div>

            <div className="chart-container">
              <h4>Product Listings by Type</h4>
              <BarChart width={300} height={300} data={productListingData}>
                <XAxis dataKey="type" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="count" fill="#82ca9d" />
              </BarChart>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
